text:
“침묵하던 당신의 마음 속 중립은 더 이상 통하지 않는다.” [스쿨미투 캠페인 참여방법]
1. #스쿨미투 #metoo 해시태그와 함께 자신의 연대문장을 올린다.
2. 인증 사진을 찍는다.
3. 최소 3명 이상의 사람을 태그한다.
4. 태그 받은 사람들은 캠페인에 참여한다.

의미있는 캠페인에 참여할 수 있게 지목해주신 @02study_nalin 님, @ihaeun_study 님, @d.c.t_study_bella 님께 감사드립니다🙏🏻 제가 지목할 분들은
@shahii_922 
@dream_in_06 
@chaeng910 
@jd_yerim 
@shoo_j.s.m 
@hyeonystudy_03 
@cherry_happy03 
입니다. 함께 참여해주세요!!
#스쿨미투 #metoo #withyou #우리는연대한다

