text:
next film screening - chicago
injustice for all film festival
🔹
we’re two weeks away from my next film screening for the abused at the injustice for all film festival in chicago! mark your calendars!!
🔹
the official screening time is saturday, october 13th at 4pm at the trinity ucc - sanctuary - 400 w. 95th street, in chicago!!
🔹
all movie screenings are free so if you’re able to make it out to the event, please do so!
🔹
it is an absolute honor to continue to be able to give voice to those who have either been victims of domestic violence or had to comfort someone whose had to suffer through the ordeal itself. 🔹
thank you guys so much for continuing to support my passion and unyielding love for spoken word poetry and filmmaking as a whole as well. 🔹
stay tuned for more updates…!
🔹
happy sunday!
.
.
.
